    XW += x[8]*13.019120; /*CH */
    XW += x[9]*14.027090; /*CH2 */
    XW += x[10]*14.027090; /*CH2* */
    XW += x[11]*15.035060; /*CH3 */
    XW += x[12]*16.043030; /*CH4 */
    XW += x[13]*28.010550; /*CO */
    XW += x[14]*44.009950; /*CO2 */
    XW += x[15]*29.018520; /*HCO */
    XW += x[16]*30.026490; /*CH2O */
    XW += x[17]*31.034460; /*CH3O */
    XW += x[18]*26.038240; /*C2H2 */
