    XW += x[23]*30.070120; /*C2H6 */
    XW += x[24]*41.029670; /*HCCO */
    XW += x[25]*42.037640; /*CH2CO */
    XW += x[26]*43.045610; /*CH2CHO */
    XW += x[27]*44.053580; /*CH3CHO */
