    /*reaction 201: nC3H7 + O <=> C2H5 + CH2O */
    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[2]*sc[30];
    k_f = 1.0000000000000002e-06 * 96000000000000
                * exp(0 * tc[0] - 0.50321666580471969 * (0) * invT);
