    Kc = exp(g_RT[4] - g_RT[5] - g_RT[29] + g_RT[30]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[4] + h_RT[30]) + (h_RT[5] + h_RT[29]));
    dkrdT = (dlnkfdT - dlnKcdT)*k_r;
