    wdot[4] -= q; /* OH */
    wdot[5] += q; /* H2O */
    wdot[29] += q; /* C3H6 */
    wdot[30] -= q; /* nC3H7 */
    /* d()/d[OH] */
    dqdci =  + k_f*sc[30];
