    J[105] += dqdci;              /* dwdot[HO2]/d[O2] */
    J[128] += dqdci;              /* dwdot[C3H6]/d[O2] */
    J[129] -= dqdci;              /* dwdot[nC3H7]/d[O2] */
    /* d()/d[HO2] */
    dqdci =  - k_r*sc[29];
    J[201] -= dqdci;              /* dwdot[O2]/d[HO2] */
    J[204] += dqdci;              /* dwdot[HO2]/d[HO2] */
    J[227] += dqdci;              /* dwdot[C3H6]/d[HO2] */
    J[228] -= dqdci;              /* dwdot[nC3H7]/d[HO2] */
    /* d()/d[C3H6] */
    dqdci =  - k_r*sc[6];
    J[960] -= dqdci;              /* dwdot[O2]/d[C3H6] */
    J[963] += dqdci;              /* dwdot[HO2]/d[C3H6] */
    J[986] += dqdci;              /* dwdot[C3H6]/d[C3H6] */
    J[987] -= dqdci;              /* dwdot[nC3H7]/d[C3H6] */
    /* d()/d[nC3H7] */
    dqdci =  + k_f*sc[3];
    J[993] -= dqdci;              /* dwdot[O2]/d[nC3H7] */
    J[996] += dqdci;              /* dwdot[HO2]/d[nC3H7] */
    J[1019] += dqdci;             /* dwdot[C3H6]/d[nC3H7] */
    J[1020] -= dqdci;             /* dwdot[nC3H7]/d[nC3H7] */
    /* d()/dT */
    J[1059] -= dqdT;              /* dwdot[O2]/dT */
    J[1062] += dqdT;              /* dwdot[HO2]/dT */
    J[1085] += dqdT;              /* dwdot[C3H6]/dT */
    J[1086] -= dqdT;              /* dwdot[nC3H7]/dT */

    /*reaction 204: nC3H7 + HO2 <=> C2H5 + OH + CH2O */
    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[6]*sc[30];
    k_f = 1.0000000000000002e-06 * 24000000000000
                * exp(0 * tc[0] - 0.50321666580471969 * (0) * invT);
    dlnkfdT = 0 * invT + 0.50321666580471969 *  0  * invT2;
    /* reverse */
    phi_r = sc[4]*sc[16]*sc[22];
    Kc = refC * exp(-g_RT[4] + g_RT[6] - g_RT[16] - g_RT[22] + g_RT[30]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[6] + h_RT[30]) + (h_RT[4] + h_RT[16] + h_RT[22]) - 1.000000);
    dkrdT = (dlnkfdT - dlnKcdT)*k_r;
    /* rate of progress */
    q = k_f*phi_f - k_r*phi_r;
    dqdT = (dlnkfdT*k_f*phi_f - dkrdT*phi_r);
    /* update wdot */
    wdot[4] += q; /* OH */
    wdot[6] -= q; /* HO2 */
    wdot[16] += q; /* CH2O */
    wdot[22] += q; /* C2H5 */
    wdot[30] -= q; /* nC3H7 */
    /* d()/d[OH] */
    dqdci =  - k_r*sc[16]*sc[22];
    J[136] += dqdci;              /* dwdot[OH]/d[OH] */
    J[138] -= dqdci;              /* dwdot[HO2]/d[OH] */
    J[148] += dqdci;              /* dwdot[CH2O]/d[OH] */
    J[154] += dqdci;              /* dwdot[C2H5]/d[OH] */
    J[162] -= dqdci;              /* dwdot[nC3H7]/d[OH] */
    /* d()/d[HO2] */
    dqdci =  + k_f*sc[30];
    J[202] += dqdci;              /* dwdot[OH]/d[HO2] */
    J[204] -= dqdci;              /* dwdot[HO2]/d[HO2] */
    J[214] += dqdci;              /* dwdot[CH2O]/d[HO2] */
    J[220] += dqdci;              /* dwdot[C2H5]/d[HO2] */
    J[228] -= dqdci;              /* dwdot[nC3H7]/d[HO2] */
