    dqdci =  - k_r*sc[4]*sc[22];
    J[532] += dqdci;              /* dwdot[OH]/d[CH2O] */
    J[534] -= dqdci;              /* dwdot[HO2]/d[CH2O] */
    J[544] += dqdci;              /* dwdot[CH2O]/d[CH2O] */
    J[550] += dqdci;              /* dwdot[C2H5]/d[CH2O] */
    J[558] -= dqdci;              /* dwdot[nC3H7]/d[CH2O] */
    /* d()/d[C2H5] */
    dqdci =  - k_r*sc[4]*sc[16];
    J[730] += dqdci;              /* dwdot[OH]/d[C2H5] */
    J[732] -= dqdci;              /* dwdot[HO2]/d[C2H5] */
    J[742] += dqdci;              /* dwdot[CH2O]/d[C2H5] */
    J[748] += dqdci;              /* dwdot[C2H5]/d[C2H5] */
    J[756] -= dqdci;              /* dwdot[nC3H7]/d[C2H5] */
