    J[994] += dqdci;              /* dwdot[OH]/d[nC3H7] */
    J[996] -= dqdci;              /* dwdot[HO2]/d[nC3H7] */
    J[1006] += dqdci;             /* dwdot[CH2O]/d[nC3H7] */
    J[1012] += dqdci;             /* dwdot[C2H5]/d[nC3H7] */
    J[1020] -= dqdci;             /* dwdot[nC3H7]/d[nC3H7] */
