    J[1060] += dqdT;              /* dwdot[OH]/dT */
    J[1062] -= dqdT;              /* dwdot[HO2]/dT */
    J[1072] += dqdT;              /* dwdot[CH2O]/dT */
    J[1078] += dqdT;              /* dwdot[C2H5]/dT */
    J[1086] -= dqdT;              /* dwdot[nC3H7]/dT */

    /*reaction 205: nC3H7 + CH3 <=> CH4 + C3H6 */
    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[11]*sc[30];
    k_f = 1.0000000000000002e-06 * 11000000000000
                * exp(0 * tc[0] - 0.50321666580471969 * (0) * invT);
    dlnkfdT = 0 * invT + 0.50321666580471969 *  0  * invT2;
    /* reverse */
    phi_r = sc[12]*sc[29];
    Kc = exp(g_RT[11] - g_RT[12] - g_RT[29] + g_RT[30]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[11] + h_RT[30]) + (h_RT[12] + h_RT[29]));
    dkrdT = (dlnkfdT - dlnKcdT)*k_r;
    /* rate of progress */
    q = k_f*phi_f - k_r*phi_r;
    dqdT = (dlnkfdT*k_f*phi_f - dkrdT*phi_r);
    /* update wdot */
    wdot[11] -= q; /* CH3 */
    wdot[12] += q; /* CH4 */
    wdot[29] += q; /* C3H6 */
    wdot[30] -= q; /* nC3H7 */
    /* d()/d[CH3] */
    dqdci =  + k_f*sc[30];
    J[374] -= dqdci;              /* dwdot[CH3]/d[CH3] */
    J[375] += dqdci;              /* dwdot[CH4]/d[CH3] */
    J[392] += dqdci;              /* dwdot[C3H6]/d[CH3] */
    J[393] -= dqdci;              /* dwdot[nC3H7]/d[CH3] */
    /* d()/d[CH4] */
    dqdci =  - k_r*sc[29];
    J[407] -= dqdci;              /* dwdot[CH3]/d[CH4] */
    J[408] += dqdci;              /* dwdot[CH4]/d[CH4] */
    J[425] += dqdci;              /* dwdot[C3H6]/d[CH4] */
    J[426] -= dqdci;              /* dwdot[nC3H7]/d[CH4] */
    /* d()/d[C3H6] */
    dqdci =  - k_r*sc[12];
    J[968] -= dqdci;              /* dwdot[CH3]/d[C3H6] */
    J[969] += dqdci;              /* dwdot[CH4]/d[C3H6] */
    J[986] += dqdci;              /* dwdot[C3H6]/d[C3H6] */
    J[987] -= dqdci;              /* dwdot[nC3H7]/d[C3H6] */
    /* d()/d[nC3H7] */
    dqdci =  + k_f*sc[11];
    J[1001] -= dqdci;             /* dwdot[CH3]/d[nC3H7] */
    J[1002] += dqdci;             /* dwdot[CH4]/d[nC3H7] */
    J[1019] += dqdci;             /* dwdot[C3H6]/d[nC3H7] */
    J[1020] -= dqdci;             /* dwdot[nC3H7]/d[nC3H7] */
    /* d()/dT */
    J[1067] -= dqdT;              /* dwdot[CH3]/dT */
    J[1068] += dqdT;              /* dwdot[CH4]/dT */
